Сопротивляет вам (psychically). Источник 
discontent. Рестриктивные усилия в обморочном; 
страхи, тревожности; ощупывания виновности.

Где вознаграждения можно предпологать. Отношение 
с естественной окружающей средой. Упования и ожиданности; 
поворотныйа пункт; прогрессирующие изменения; 
результаты более предыдущих действий.

Тайное влияние, положение весь быть. Отношение с 
numinous окружающей средой. Управляющие силы в обморочном; 
мотивировка; чувство цели.

Вещь внимание. Дорога к богам. Сильная 
защитная сторона в обморочном; влияние защитит вас; 
вероисповедные устремленности.
